マイクロロン樹脂（フッ素加工物）を配合し、ミルスペックMIL-L-210-Bの要件にマッチするハイポイドギヤー用潤滑剤です。API分類によるクラスはGL-5に該当します。また、ディファレンシャルギヤーの潤滑剤を含んでいますので、泡止め性、錆止め性、そしてすぐれた酸化安定性を持っています。 <br><br>あらゆる車のマニュアルミッション用、ディファレンシャルギヤー用及びその他、密閉機構にお勧めできます。耐摩耗性ハイポイドギヤーとトランスミッションでの磨耗と損傷を最小限に抑え、騒音を下げ結果としてその寿命を延長いたします。高性能レーシングカーの為に特定のメーカーと提携して特別高級なノンスリップデフ用添加剤を加えてあります。<br><br>必要量の目安＝オイル容量の１０％ <br><br>ユニバーサル  <br><br>　車検対応品<br><br>ケミカル系/添加剤<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


